		48D6F2B2179D6E0700F23494 /* Copy Helper Tools */ = {
			isa = PBXCopyFilesBuildPhase;
			buildActionMask = 2147483647;
			comments = "Here is why this is empty:\n\nThis must be a common situation with a common solution.\n\nMy project has an Cocoa Application target and some Helper-tool targets. Even for testing, the Helper tools need to be in the application's package, in Contents/MacOS or Contents/Helpers, so that they can access needed resources and frameworks. Otherwise they won't work.\n\nSo, I have set in the helpers' Target Build Settings a Per-Configuration Build Products path of:\n\n $(BUILD_DIR)/$(CONFIGURATION)$(EFFECTIVE_PLATFORM_NAME)/$(PROJECT_NAME).app/Contents/Helpers\n\neffectively placing them into their final destination, instead of in my normal Build Directory.\n\nSurprisingly, this seems to work out OK, even if I \"clean\" everything. Of course, I have set the main app to have the helpers as dependencies. When the first helper builds, it creates a \"MainApp.app\" directory which is entirely empty except for Contents/Helpers/TheHelper. Later, when the main app builds, it builds into this same directory, without touching the Helper executables.\n\nIt bothers me a little that the main app's target does ^not^ have a Copy Files Build Phase for copying the helpers into Contents/Helpers, because the only thing I could put in there would be executables that are already where they would be copied it to. I understand that this is not necessary because of the dependency, but I'd sleep easier if it were there as a backup -- accidentally shipping a product without a helper would make for a very sad day.\n\nI've tried building the helpers to my regular Builds directory and doing an \"Install\" to the app package, but could never get that to work. Also, I understand that anything can be done with a Shell Script Build Phase, but I like to avoid that whenever possible because of their low visibility.\n\nI'm surprised that it took me years to discover this \"solution\". Is this the approach intended by Apple for this situation? Is there a better way?\n\nSincerely,\n\nJerry Krinock\n";
			dstPath = Contents/Helpers;
			dstSubfolderSpec = 1;
			files = (
				48E6E6922B46139200113FFC /* BkmxAgentRunner.app in Copy Helper Tools */,
				48813DC72460DD2200F0166C /* BkmxNotifier-B.app in Copy Helper Tools */,
				48813DC82460DD2200F0166C /* BkmxNotifier-A.app in Copy Helper Tools */,
				48CA7628195CC2FA003FC228 /* Chromessenger in Copy Helper Tools */,
				48D6F2B3179D6E0700F23494 /* Sheep-Sys-UrlHandler.app in Copy Helper Tools */,
				48D6F2B4179D6E0700F23494 /* Sheep-Sys-Thomas in Copy Helper Tools */,
				48D6F2B7179D6E0700F23494 /* FileAliasWorker in Copy Helper Tools */,
			);
			name = "Copy Helper Tools";
			runOnlyForDeploymentPostprocessing = 0;
		};
