			comments = "# Why CopyJSConstantsToC is a Dependency\n\nCopyJSConstantsToC is a dependency because it generates ConstsFromJavaScript.h/.c which are included and linked into this target.\n\n-------------------------------------------------\n\n# Why Any .c Files Must Be set in Info panel to File Type = sourcecode.c.objc\n\nNote: There is only one .c file in the project:\nAuthorizedTasks+SetAnyUserPrefs.c\n\nOn 2009 Mar 14, at 19:46, Chris Espinosa wrote:\n\nThe good target uses a prefix file that conditionally #includes AppKit.h only when building Objective-C code.\n\nJerry:  Yes.\n\nThe bad target unconditionally uses AppKit.h as its Prefix Header setting.\n\nYes, $(SYSTEM_LIBRARY_DIR)/Frameworks/AppKit.framework/Headers/AppKit.h\n\nAnd the good target uses:\n\n#ifdef __OBJC__\n#import <Cocoa/Cocoa.h>\n#endif\n\nChris:  It's a performance vs. flexibility tradeoff. Using AppKit.h as the prefix file increases the odds of reusing an already-built pch file. But it limits you to .m or .mm files, or as you discovered, C files declared to be Objective-C.\n\n-------------------------------------------------\n\n# Sparkle \"Installation Directory\".\n\nIn Sparkle 1.5, as it ships from Andy, in the Framework target > Build Settings, Installation Directory is @loader_path/../Frameworks.  This doesn't work for us because we use Sparkle as a \"framework within a framework\".  The \"loader\" is, I guess, Bkmxworks.framework.  I tried putting a copy of Sparkle.framework at Bkmxworks/../Frameworks, i.e. BookMacster.app/Contents/Frameworks/Bkmxworks/Versions/A/Frameworks.  I think that should have worked, but it didn't.\n\nSo, the solution I used was to hack into the Sparkle project, Framework target > Build Settings and change Installation Directory to @executable_path/../Frameworks.  Now it works.\n\nFor definitions of @loader_path and @executable_path see:\n\nhttp://developer.apple.com/documentation/DeveloperTools/Conceptual/DynamicLibraries/100-Articles/DynamicLibraryDesignGuidelines.html#//apple_ref/doc/uid/TP40002013";
