			comments = "On 20090819, in order to work around Apple Bug 7145893, I stopped stripping in Xcode and now strip in ShipProduct.pl.\n\nCheckboxes that were checked, now unchecked:\n\nDeployment Postprocessing\nStrip Debug Symbols During Copy\nStrip Linked Product\nDead Code Stripping\n\nThe Strip Styles were \"All Symbols\" for Bookdog main, Bookwatchdog main, and Bkmxwork; Non-Global Symbols for other frameworks.\n\n-------------------------------------------------------------------------------\n\nThe spaces between [consecutive macros] in the macro expansion process can be avoided by passing -CC to the Info.plist Other Preprocessor Flags build setting.\nThe things that Xcode replaces DO want the ${...}, but the things that the gcc preprocessorreplaces do NOT want the ${...}\n\nFROM APPLE TN1275, for SPARKLE URL\nUsing the GCC C preprocessor to preprocess your Info.plist files may have some unintended side-effects. Such as using URLs in your file. That is, the C preprocessor treats the text in the same way it would treat source code - anything following \"//\" characters are treated as comments and discarded. Therefore, a <string> property that is originally represented as this:\n<string>http://developer.apple.com</string>\nwill get converted into this:\n<string>http:\nTo work around this feature of the C preprocessor, we can pass the -traditional flag to the Info.plist Other Preprocessor Flags build setting in Xcode. This will cause the preprocessor to use the traditional ANSI C /* and */ character strings as tokens to recognize and discard text as comments.\nLater, I found that -CC seemed to do the same thing.  See man gcc.\n\n\nI suspect that the source text \"$\" is being replaced\nbefore gcc's preprocessor ever gets run. This would be happening because\n$ looks like a replaceable Xcode variable, so if the value\nof RELEASE_VERSION is nil or empty, it gets replaced by nothing. You're\nthe victim of colliding replacement mechanisms.\n\nA way to test this hypoth